# Stores the net numbers of the 27 nets I gave to Julie.
# The net numbers are grouped by number of vertex connections, so the first grouping is the 3 of Vc=2, the second
# group is the 3 of Vc=3, etcetera
array = [[35048, 43253, 43374], [19031, 27884, 22840], [41635, 16750, 10337], [33987, 9025, 23207],
         [33980, 40881, 32036], [5886, 8905, 30578], [35386, 26228, 24269], [10228, 20504, 13528], [42771, 14505, 526]]

# This for loop goes from 2 to 10 and creates a scatter plot for each number of vertex connections
for i in range(2, 11):
    # ch_list will become x_list and rg_list will become y_list, but we will filter out all of the entries except
    # for those corresponding to a net with the desired number of vertex connections.
    x_list = []
    y_list = []
    for j in range(len(vc_list)):  # For each Dürer net
        if vc_list[j] == i:  # If the net has i vertex connections we append the data to our x_list and y_list to be
            # plotted
            # x_list.append(ch_list[j])
            x_list.append(pr_list[j])
            y_list.append(rg_list[j])

    # Calculates the correlation and R^2 value for the subset of the data (x_list, y_list)
    correlation = np.corrcoef(x_list, y_list)[0, 1]
    r_squared = correlation ** 2

    # Plots the lists we generated for i vertex connections
    plt.scatter(x_list, y_list, s=20, alpha=0.1, edgecolors="k")

    # Makes 2 more lists, x2_list and y2_list. These will store the coordinates to plot the nets we gave to Julie
    # and show where they lie in this space.
    x2_list = []
    y2_list = []
    for j in array[i - 2]:  # Calls the row of net numbers for the number of vertex connections
        # we are currently looking at
        # for each of the three entries in the given row

        # append area of the convex hull to the x2_list
        x2_list.append(convex_hull("Dodecahedron", str(j).zfill(5), False))

        # Calculates the radius of gyration and appends it to the y2_list
        data = loadfile(name, str(j).zfill(5))
        v = np.array(data.get("Vertices"))
        f = np.array(data.get("Faces"))
        y2_list.append(radiusg(v, f))

    # Adds the coordinates of the nets we sampled to the full scatter plot of that space in a different color
    # and larger size so they stand out more.
    # plt.scatter(x2_list, y2_list, alpha=1, edgecolors="red")

    # Labels the x-axis, y-axis, and the title of the diagram
    plt.xlabel("Perimeter of Convex Hull" + "R^2 = " + str(round(r_squared, 3)))
    plt.ylabel("Radius of Gyration")
    plt.title("Radius of Gyration versus Perimeter of Convex Hull for Vc = " + str(i))

    # Finds slope and y-intercept of the line of best fit
    b, a = np.polyfit(x_list, y_list, deg=1)

    # Creates an evenly spaced list of x values
    xseq = np.linspace(20, 30, num=200)

    # Plots the line of best fit
    plt.plot(xseq, a + b * xseq, color="k", lw=2.5)

    # Prints the value of R^2
    print("R^2 is " + str(r_squared))
    print(b, a)

    # Saves the figure as a file
    plt.savefig("rg_versus_pr graph Vc= " + str(i), dpi=900)

    # Makes the plot visible
    plt.show()
